import React from 'react';



class App extends React.Component{
  componentDidMount(){
    fetch("http://localhost:3000/api/g1/groomer") //asyn - request goes to backend, look meanwhile returns a promise
    .then(res => res.json())
    .then(data => console.log(data))
  }
  render() {
    return (
      <div className="App">
        App
      </div>
    );
  }
}


export default App;
